from typing import List
from collections import deque 

class Solution:
  def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
    rows = len(mat)
    cols = len(mat[0])
    queue = deque()
    output = [[0 for _ in range(cols)] for _ in range(rows)]
    visited = set()

    for i in range(rows):
      for j in range(cols):
        if mat[i][j] == 0:
          visited.add((i, j))
          output[i][j] = 0
        else:
          queue.append((i, j))


    while queue:
      for _ in range(len(queue)):
        i, j = queue.popleft()

        distance = float('inf')
        for (x, y) in visited:
          distance = min(distance, abs(x-i) + abs(y-j))
        
        output[i][j] = distance

    return output

